INSERT INTO `answer_options` (`id`, `text`, `question_id`, `is_right`, `deleted_at`) VALUES
(1, 'Вовк хоч і як ненависний був йому.', 1, 1, '2020-04-30 18:06:05'),
(2, 'А тим часом монголи на ріні над Опором.', 1, 1, '2020-04-30 18:06:05'),
(3, 'Але інших шляхів ми - нещасливі,а чи.', 1, 1, '2020-04-30 18:06:05'),
(4, 'Мирослава позлазили з коней і.', 2, 1, '2020-04-30 18:06:05'),
(5, 'Рятунку! скрикнула у смертельній.', 2, 1, '2020-04-30 18:06:05'),
(6, 'Опору. Високі, стрімкі береги.', 2, 0, '2020-04-30 18:06:05'),
(7, 'Але ж се землі й ліси громадські!.', 3, 1, NULL),
(8, 'Максима. Тоді товариство розділилося.', 3, 0, NULL),
(9, 'Максим. - Нема боярина Тугара Вовка!.', 3, 0, NULL),
(10, 'Захар Беркут покинув ворожбита і пішов.', 3, 0, NULL),
(11, 'Се лютило боярина чимраз дужче, і він.', 3, 1, NULL),
(12, 'Так ми зможемо найліпше зігнати все до.', 4, 1, NULL),
(13, 'На кождого з героїв навалилася ціла.', 4, 1, NULL),
(14, 'Повними ненависті й погорди очима.', 4, 0, NULL),
(15, 'Потім підемо горі плаєм і - стараймося.', 5, 1, NULL),
(16, 'А щоб не зацікавитися розкладом табора.', 5, 0, NULL),
(17, 'Мовчи, смерде! перебив його лютим.', 5, 0, NULL),
(18, 'Щоби з\'єдинити в одних руках силу.', 5, 1, NULL),
(19, 'І хоч не раз бунтувалася проти тої.', 6, 1, NULL),
(20, 'Максима за руку і пішла з ним долі.', 6, 0, NULL),
(21, 'Шляхи наші хоч неширокі, але - самої.', 7, 1, NULL),
(22, 'Хіба ти - вирятував її життя з великої.', 7, 0, NULL),
(23, 'Нараз рик рогів утих і ловці пустилися.', 7, 1, NULL),
(24, 'Сей ланцюг - то не забавка, то.', 8, 1, NULL),
(25, 'Тільки ж і обляжеш, що готовилися на.', 8, 1, NULL),
(26, 'Постій, боярине, ми ще - раз, бо се не.', 8, 1, NULL),
(27, 'Ходи, їдьмо до цілі! Що буде, те буде.', 9, 1, NULL),
(28, 'Як ти все те запалювало його гарячу.', 9, 1, NULL),
(29, 'Таке положення улегшувало нашим ловцям.', 9, 0, NULL),
(30, 'Він за молодших часів часто ходив по.', 9, 1, NULL),
(31, 'Беркута за його голосом!» «Так, мамо!».', 10, 1, NULL),
(32, 'Сліпо полягаючи на його словах у.', 10, 1, NULL),
(33, 'Я рад би, боярине, щоб між ту.', 10, 0, NULL),
(34, 'Не гнівайся, боярине, за слова смієш.', 10, 1, NULL),
(35, 'Кайданом. Монгольські загони, які він.', 11, 1, NULL),
(36, 'Кожде колісце в тім усім покладав.', 11, 0, NULL),
(37, 'Вона, бідна, й не стісняв ні в чім.', 11, 1, NULL),
(38, 'Але й боярин сидів тепер якийсь.', 11, 0, NULL),
(39, 'Невже ж ти так хвалишся! - Бо зважай.', 11, 1, NULL),
(40, 'Правда, боярине, до тебе - закличуть.', 12, 1, NULL),
(41, 'Раптом медведиця вхопила в передні.', 12, 1, NULL),
(42, 'Тугар Вовк. - Говори! сказав боярин.', 12, 0, NULL),
(43, 'Сей ланцюг - то будуть їм могли багато.', 12, 1, NULL),
(44, 'Пети, відділилася від головної орди в.', 13, 1, NULL),
(45, 'Захара, сказані грізним, піднесеним.', 13, 1, NULL),
(46, 'Калкою. - І ти їм хочеш видати.', 14, 1, NULL),
(47, 'Вона може нас зробити трупами, але не.', 14, 0, NULL),
(48, 'Невже ж зухвалість ваша така безмежна.', 14, 1, NULL),
(49, 'Невже ж таки, чесні сусіди, моє слово.', 14, 0, NULL),
(50, 'Тоді, не зупиняючись довше, він велів.', 15, 1, NULL),
(51, 'Перейшовши на арпадський бік, я вдарю.', 15, 1, NULL),
(52, 'Зламана у них давня відвага.', 15, 1, NULL),
(53, 'Бояри, покинувши свої становища.', 15, 0, NULL),
(54, 'Прихильний засуд значить признання не.', 16, 1, NULL),
(55, 'Зійшли вже на долину. Під водопадом.', 16, 1, NULL),
(56, 'Дух бунту і непокори живе в народі.', 16, 0, NULL),
(57, 'Лиш сього - (показав на Максима) не.', 17, 1, NULL),
(58, 'За хатами стояли стайні та інші.', 17, 1, NULL),
(59, 'Чому вона - червона? Бо значить кров!.', 17, 0, NULL),
(60, 'Беркута,- діти слухають тривожно, в їх.', 17, 0, NULL),
(61, 'Але нехай собі! Думка поета летить у.', 18, 1, NULL),
(62, 'Він не тільки тратили часть своїх.', 18, 0, NULL),
(63, 'При вході в долину аж над самі ріки.', 18, 1, NULL),
(64, 'Лице його ясніло. Він підніс руку.', 18, 0, NULL),
(65, 'Тугар Вовк скликав знатніших їх.', 19, 1, NULL),
(66, 'Максим. Він добре каже! Він урятував.', 19, 1, NULL),
(67, 'Вовк, а другу Максим. Мирослава з.', 20, 1, NULL),
(68, 'Гаряче слово і велика повага Захара.', 20, 1, NULL),
(69, 'А зв\'язки ті були тоді ще досить живі.', 20, 0, NULL),
(70, 'Добре, коли така ваша воля,сказав.', 20, 1, NULL),
(71, 'Максим держався тепер позаду бояр; він.', 20, 1, NULL),
(72, 'Княжий післанець прибув пізненько наші.', 21, 1, NULL),
(73, 'Гурра, Максим! Гурра, Тухольщи-на!.', 21, 1, NULL),
(74, 'Ану, мої слуги, ходімо з сього.', 21, 1, NULL),
(75, 'Вся громада - приступом на остінок.', 21, 0, NULL),
(76, 'Бескида та через те щез він ловцям з.', 22, 1, NULL),
(77, 'У смертельній тривозі, яка й.', 22, 0, NULL),
(78, 'Понад тим ланцюгом повівала червона.', 22, 0, NULL),
(79, 'Тугар Вовк, - обертаючись лицем до.', 23, 1, NULL),
(80, 'Акинтія, і одверто розповів йому про.', 23, 0, NULL),
(81, 'Максим Беркут посеред невеличкої.', 23, 0, NULL),
(82, 'Нараз захрустів лім і грізно-люто.', 24, 1, NULL),
(83, 'Він підняв Мирославу і міцно притиснув.', 24, 0, NULL),
(84, 'Мимоволі стрепенулася тухольська.', 25, 1, NULL),
(85, 'Се чисто розбійницькі війни. - Я чув.', 25, 1, NULL),
(86, 'Говори про себе, не розуміючи того, що.', 26, 1, NULL),
(87, 'Мій і ваш пан князь Данило дарував.', 26, 0, NULL),
(88, 'Морани, богині смерті. Але коли.', 27, 1, NULL),
(89, 'Кажуть, що колись Морана ще раз.', 27, 0, NULL),
(90, 'А рівночасно з двох боків піднято на.', 27, 1, NULL),
(91, 'Забризкала кров, залунали крики і.', 27, 0, NULL),
(92, 'Захар розу^ мів добре, що його батько.', 28, 1, NULL),
(93, 'Захар устав і, звертаючись до громади.', 28, 0, NULL),
(94, 'Я просив у тебе б свій батько, і, як.', 28, 1, NULL),
(95, 'Вони не тільки лікарем, але й не.', 28, 1, NULL),
(96, 'Та ледве Мирослава могла дослідити, що.', 28, 1, NULL),
(97, 'Гі не потрібно. Я - потребую такої.', 29, 1, NULL),
(98, 'І «проганяєш наших пастухів, убиваєш.', 29, 1, NULL),
(99, 'Серце його - найвірнішим лучником.', 30, 1, NULL),
(100, 'Хіба ти - забула, що ти присвоюєш собі.', 30, 0, NULL),
(101, 'Ану ж боярин зуміє підмовити князя.', 30, 1, NULL),
(102, 'Поки один стояв при тих словах, щоб.', 30, 1, NULL),
(103, 'Дивна недослідна, а всім чутна тривога.', 31, 1, NULL),
(104, 'Потім глянув долі вивозом і не сміла.', 31, 0, NULL),
(105, 'Одна - пішла на захід, мабуть, під.', 31, 1, NULL),
(106, 'Морана не має ніякої і не доводити.', 31, 1, NULL),
(107, 'Сонце праведне! кликнув у своїй.', 31, 0, NULL),
(108, 'Не тикай, боярине, наших земель і його.', 32, 1, NULL),
(109, 'До зброї, браття, до зброї! Монголи!.', 32, 1, NULL),
(110, 'Тухольщини і дав їм знайти праву.', 32, 1, NULL),
(111, 'Княжий післанець прибув пізненько наші.', 32, 0, NULL),
(112, 'По обох боках остінка. Раптом, мов на.', 32, 0, NULL),
(113, 'Смерком уже їхало вузьким плаєм поверх.', 33, 1, NULL),
(114, 'Се були стіни без вікон і дверей, тож.', 33, 1, NULL),
(115, 'Який ти страшний, таточку,прошепотіла.', 33, 0, NULL),
(116, 'А - може… може, й він міг би послужити.', 33, 0, NULL),
(117, 'Тугар Вовк, - обертаючись лицем до.', 33, 1, NULL),
(118, 'Так. - А прецінь нас скривдив, отою.', 34, 1, NULL),
(119, 'Ціла околиця раптом ожила; дно озера.', 34, 0, NULL),
(120, 'Луна покотилася полонинами.', 34, 1, NULL),
(121, 'А товариші гнали слідом за ними.', 34, 0, NULL),
(122, 'Сонце доходило вже полудня і стояло.', 34, 0, NULL),
(123, 'Я боярин князя Данила,гордо відповідав.', 35, 1, NULL),
(124, 'Калкою зрадив Русь монголам, виявивши.', 35, 1, NULL),
(125, 'Післанці з угро-руських громад.', 35, 1, NULL),
(126, 'Величезним скоком підплигнув медвідь і.', 35, 0, NULL),
(127, 'Від якого царя приносиш нам вісти?.', 36, 1, NULL),
(128, 'Від скал, що затіснювали виплив потоку.', 36, 1, NULL),
(129, 'Але Тугар Вовк з подивом, майже зо.', 36, 1, NULL),
(130, 'По шляху надійшла тульська ватага і.', 37, 1, NULL),
(131, 'Але, на щастя, боярина не - хоче.', 37, 0, NULL),
(132, 'Тугар Вовк і Мирослава зуміє додержати.', 37, 0, NULL),
(133, 'Шумно збиралася мо-лодіж і ставала.', 37, 0, NULL),
(134, 'Не вспіли вівчарі до ладу розказати.', 38, 1, NULL),
(135, 'Мов один величезний камінь, випущений.', 38, 1, NULL),
(136, 'Твій батько має велику вдасть над.', 38, 0, NULL),
(137, 'Очевидно, провадив їх хтось добре.', 38, 0, NULL),
(138, 'Максим узяв їх на руки і вони ж мали б.', 39, 1, NULL),
(139, 'Гурра! закричали радісно молодці.', 39, 0, NULL),
(140, 'Заграли труби, і завили дикими.', 40, 1, NULL),
(141, 'Ти, старче, не знаєш усього того, і.', 40, 0, NULL),
(142, 'це спеціальна конструкція, яка використовується для групування пов\'язаних змінних та функцій.', 1, 1, NULL),
(143, 'це функція, що дає змогу отримати значення глобальних змінних.', 1, 0, NULL),
(144, 'це макет, по якому можна створювати об\'єкти.', 1, 1, NULL),
(145, 'Лише 1', 2, 0, NULL),
(146, 'Скільки потрібно', 2, 1, NULL),
(147, 'Скільки визначить програміст', 2, 0, NULL);
