INSERT INTO `questions` (`id`, `question`, `test_id`, `deleted_at`) VALUES
(1, 'Що таке клас?', 1, NULL),
(2, 'Скільки методів може містити клас?', 1, NULL),
(3, 'Деякі мали бути внутрі дому, щоб доносити з боярського?', 4, NULL),
(4, 'Захара. Хвилю він вагувався, чи відповідати дальше на його?', 2, NULL),
(5, 'Вона була в лісі, і кождеї погідної днини Захар Беркут?', 2, NULL),
(6, 'Так, тату! Ти дуже хитрий, такий хитрий, що аж себе самого?', 4, NULL),
(7, 'Закличникн, тричі поклонившися громаді, вийшли під липу і?', 3, NULL),
(8, 'Коли так, то хоч цар велетнів і не знаємо ніякого князя?', 3, NULL),
(9, 'Монгольський табір був розложений у величезнім?', 4, NULL),
(10, 'Навіть коні під нашими їздцями почали тремтіти всім тілом?', 2, NULL),
(11, 'У смертельній тривозі, яка й найбоязливішому не раз?', 5, NULL),
(12, 'Максим Беркут: - Боярине! Дуже не впору для його серця на?', 5, NULL),
(13, 'В товаристві веселих боярських дружинників увійшли?', 4, NULL),
(14, 'Максима - Беркута. Один вдячний погляд урятованої дівчини?', 5, NULL),
(15, 'Але ніщо було діяти… Обов\'язок вдячності так був глибоко?', 5, NULL),
(16, 'За твою раду дякуємо тобі і передамо її нашим громадам?', 5, NULL),
(17, 'Не дальше як на п\'ятдесят кроків одні від других?', 5, NULL),
(18, 'Одна - пішла на захід, мабуть, під Судомир, у польську?', 4, NULL),
(19, 'І тут монгольські стріли просвистіли без шкоди для?', 2, NULL),
(20, 'За хатами стояли стайні та інші господарські будинки; там?', 5, NULL),
(21, 'Опору. Високі, стрімкі береги тухольської кітловини?', 2, NULL),
(22, 'Серце її боліло дуже: вона чула, що його прозвали?', 2, NULL),
(23, 'О ні, я не - лякаємось. Вона може нас зробити трупами, але?', 5, NULL),
(24, 'Тоді велів повиймати голі кістяки з котлів, посадити їх?', 6, NULL),
(25, 'Се була звичайна стародавня церемонія, що знаменувала?', 2, NULL),
(26, 'Не хочу його ласки! відказала Мирослава. - Зблизись?', 2, NULL),
(27, 'Ні, таточку, я здорова і скажу тобі ще раз, і кле-нусь?', 3, NULL),
(28, 'Але скоро тільки вона затрубила, медведиця схопилася з?', 2, NULL),
(29, 'Мирослава одним могучим рухом пхнула їй ратище між передні?', 4, NULL),
(30, 'Тухольщино! «Прощай батьку мій, соколе сизий! Прощайте?', 2, NULL),
(31, 'Максим до світлиці Мирослави, надіючись тут стрітити її в?', 5, NULL),
(32, 'Бояри наші зачали були робити засіки на шляху, що вів від?', 6, NULL),
(33, 'Максимом іде на кілька неділь у гори за зіллям і ліками?', 5, NULL),
(34, 'Тугаром горою навперейми, швидко десь заховався і щез, не?', 4, NULL),
(35, 'Я можу! озвався голос із народу. Мов стрілою поражений?', 2, NULL),
(36, 'Батько тихими, тривожними кроками приступив до неї, до?', 2, NULL),
(37, 'Вони сміялись тепер зі всяких пут, із цілої сили великого?', 6, NULL),
(38, 'І справді, план Бурунди був хоч і їм самим грозить та сама?', 2, NULL),
(39, 'Максим кланявся їм і вітав їх голосно, приязно; далі й?', 4, NULL),
(40, 'Я ж не лиси, - що до - гніву! Се хвиля рішуча. - Що робиш?', 2, NULL);
